import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-26bb07b9ddbc4",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\README.md").then(comp => {
        Vue.component("v-26bb07b9ddbc4", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-d880636d2d80b",
    path: "/js/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\js\\README.md").then(comp => {
        Vue.component("v-d880636d2d80b", comp.default)
        next()
      })
    }
  },
  {
    path: "/js/index.html",
    redirect: "/js/"
  },
  {
    name: "v-1b8c72525785",
    path: "/technical/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\technical\\README.md").then(comp => {
        Vue.component("v-1b8c72525785", comp.default)
        next()
      })
    }
  },
  {
    path: "/technical/index.html",
    redirect: "/technical/"
  },
  {
    name: "v-25e9a843774ac",
    path: "/vue/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\vue\\README.md").then(comp => {
        Vue.component("v-25e9a843774ac", comp.default)
        next()
      })
    }
  },
  {
    path: "/vue/index.html",
    redirect: "/vue/"
  },
  {
    name: "v-10227def9d15",
    path: "/vue/command.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\vue\\command.md").then(comp => {
        Vue.component("v-10227def9d15", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
